(103330, "Navid Negahban", 2, "1968-06-02", null, "Navid Negahban was born and raised in Mashhad, Iran. His passion for acting led him to Germany, where he spent eight years honing his theatrical skills prior to arriving in the US. Navid has been building a strong resume ever since, playing a broad range of intriguing characters for film, theatre, and television.

Navid has a powerful leading role in the stunning dramatic feature The Stoning of Soraya M., and significant supporting roles in Brothers with Tobey Maguire, directed by Jim Sheridan, Powder Blue with Jessica Biel and Forest Whitaker, and Charlie Wilson's War opposite Tom Hanks, directed by Mike Nichols. On TV, Navid had a recurring role on the eighth and final season of 24, and guest appearances include Lost, CSI: Miami, Law & Order, Covert Affairs, and NCIS: Los Angeles. Navid recently (2011) appeared as Dr. Robert Stadler in Atlas Shrugged Part 1. He also shot The Power of Few in New Orleans with Christopher Walken and Christian Slater. Navid is currently (2011/2012) playing the chilling Abu Nazir on Showtime's Homeland, with Damian Lewis and Claire Danes. Credit:  J. Bass ", "Mashhad, Iran", 1.97, "/qxp9X0SIA0FWts2qK60IcrmUhnF.jpg"),
(1106196, "Fehd Benchemsi", 2, "1978-02-16", null, "Fehd Benchemsi, Morocco's top movie star, is at the vanguard of the Arab Actors new wave. He recently starred in Hulu's acclaimed series The Looming Tower (2018) alongside international movie stars Jeff Daniels and Tahar Rahim. In 2017, he appeared in Yellow Birds (from director Alexander Moors), alongside Boardwalk Empire star Jack Huston. Benchemsi played and appeared with Bradley Cooper in Clint Eastwood's acclaimed blockbuster American Sniper (2015), as well as with Academy Award winner Nicole Kidman in Queen Of The Desert (Werner Herzog, 2015).

Benchemsi played leading or supporting roles in movies that gained national and international acclaim:

Né Quelque Part (Mohamed Hamidi, Cannes Festival, 2013),

The Man Who Sold The World (Swel & Imad Noury, Berlin Festival 2009, Award in Abu Dhabi Film Festival, 2009),

L'Orchestre des Aveugles (Mohamed Mouftakir, Golden Tanit in Carthage Film Festival 2016, selected in Marrakech Film Festival 2014, 3 awards in Bruxelles Film Festival 2015),

Death For Sale (Faouzi Bensaïdi, selected for Academy Awards Best Foreign movie race 2013, Award in Berlin Film Festival 2012, Best movie in San Fransisco Film Festival 2012).

La Vache (Mohamed Hamidi), best movie, Jury Prize, in Alpes d'Huez Film Festival 2016)

Being always ready to rise to a challenge, Benchemsi recently moved to LA, to give his career a new impetus in the motherland of the movie industry. Like most inspired and great artists, Benchemsi's talent for entertainment stretches beyond the subtle art of acting, as he also is an accomplished musician: He masters percussions and ethnic instruments, and sings Gnawa songs, Morocco's gospel. Benchemsi regularly performs during public concerts in LA with Gnawest, the ethnic jazz formation he leads .

Benchemsi was born in Casablanca, Morocco. Before he took up an artistic career, he graduated with a Law Master Degree from Aix en Provence University (France). His international background granted him a lot of ease in developing his language skills: He is fluent in Arabic, French and English.", "Casablanca, Marocco", 0.98, "/wQgm2hX25orrPaZSpkC8rETHTMP.jpg"),
