(66, "Chris Tucker", 2, "1971-08-31", null, "Christopher \"Chris\" Tucker (born August 31, 1971) is an American actor and comedian, best known for his roles as Detective James Carter in the Rush Hour trilogy and Smokey in the 1995 film Friday.  Tucker was born in Atlanta, Georgia, the youngest son of Mary Louise and Norris Tucker. Tucker was raised in Decatur, Georgia. After graduating from Columbia High School, he moved to Los Angeles to pursue a career in comedy and movies. In 1992, Tucker was a frequent performer on Def Comedy Jam. He made his cinematic debut in House Party 3, and gained greater film recognition alongside rapper Ice Cube in the 1995 film Friday. In 1997, he co-starred with Charlie Sheen in Money Talks, and alongside Bruce Willis in The Fifth Element. Tucker did not reprise his role of Smokey in Next Friday (2000) because he had become a born-again Christian after filming Money Talks (1997).He later starred in the 1998 martial arts action comedy Rush Hour and its sequels, Rush Hour 2 and Rush Hour 3, in which he played James Carter, an abrasive wise-cracking detective.  Tucker is good friends with fellow Rush Hour star Jackie Chan, and was also close friends with the late singer Michael Jackson, introducing and dancing with him at his 30th Anniversary Special, appearing in Jackson's video \"You Rock My World\" from his 2001 album Invincible and attending Jackson's memorial service. A friend of Bill Clinton, Tucker has traveled with the former President overseas, though he endorsed Barack Obama rather than Hillary Clinton in the 2008 primaries. On February 13, 2009, Tucker participated in the NBA All-Star Weekend's Celebrity Game.", "Atlanta, Georgia, USA", 3.357, "/xtAK4hFyDjSYhZ9oRhppuVcLi80.jpg"),
