(17276, "Gerard Butler", 2, "1969-11-13", null, "Gerard James Butler (born 13 November 1969) is a Scottish actor who has appeared on film, stage, and television.

A trained lawyer, Butler turned to acting in the mid-1990s with small roles in productions such as the James Bond film Tomorrow Never Dies (1997), which he followed with steady work on television, most notably in the American miniseries Attila (2001).

He garnered critical acclaim for his breakthrough work as the lead in Joel Schumacher's 2004 film adaptation of the musical The Phantom of the Opera. In 2007, Butler gained worldwide recognition through his portrayal of King Leonidas in the film 300. Since then, he has appeared in projects including P.S. I Love You (2007), Nim's Island (2008), RocknRolla (2008), The Ugly Truth (2009), Gamer (2009), Law Abiding Citizen (2009), The Bounty Hunter (2010), and How to Train Your Dragon (2010). Description above from the Wikipedia article Gerard Butler, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Paisley, Scotland, UK ", 4.96, "/wRKkVe5uugkx4KnmphBSjJUWPTo.jpg"),
(24264, "Craig Ferguson", 2, "1962-05-17", null, "Craig Ferguson (born 17 May 1962) is a Scottish-born, naturalized American television host, stand-up comedian, writer, actor, director, and producer. He is the host of The Late Late Show with Craig Ferguson, an Emmy Award-nominated, Peabody Award-winning late-night talk show that airs on CBS. In addition to hosting that program and performing stand-up comedy, Ferguson has written two books: Between the Bridge and the River, a novel, and American on Purpose, an autobiography. He became a citizen of the United States in 2008.

Before his career as a late-night television host, Ferguson was best known in the United States for his role as the office boss, Nigel Wick, on The Drew Carey Show from 1996 to 2003. After that, he wrote and starred in three films, directing one of them.

Description above from the Wikipedia article Craig Ferguson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Glasgow, Scotland, UK", 1.742, "/2ZIvieSjzfA4c8YHxs3jgHJPBta.jpg"),
(59174, "America Ferrera", 1, "1984-04-18", null, "America Georgina Ferrera (born April 18, 1984) is a Honduran-American actress, best known for playing the lead role in the television comedy series \"Ugly Betty\". Her portrayal garnered critical acclaim, and she won the Golden Globe Award for \"Best Actress in a Comedy Series\", the Screen Actors Guild Award for \"Best Female Actor in a Comedy Series\", and the Emmy Award for \"Outstanding Lead Actress in a Comedy Series\". She has also starred in Real Women Have Curves, The Dry Land, The Sisterhood of the Traveling Pants, its sequel Sisterhood of the Traveling Pants 2, and had a small role in the skateboard biopic Lords of Dogtown (2005). In addition, she was the voice of Astrid the Viking in the Dreamworks animated picture How to Train Your Dragon.", "Los Angeles, California, USA", 3.7, "/9xuc962JhsW51bCFURtel7RBrMM.jpg"),
