(3636, "Paul Newman", 2, "1925-01-26", "2008-09-26", "From Wikipedia, the free encyclopedia

Paul Leonard Newman (January 26, 1925 – September 26, 2008) was an American actor, film director, entrepreneur, humanitarian, professional racing driver, auto racing team owner, and auto racing enthusiast. He won numerous awards, including an Academy Award for best actor for his performance in the 1986 Martin Scorsese film The Color of Money and eight other nominations, three Golden Globe Awards, a BAFTA Award, a Screen Actors Guild Award, a Cannes Film Festival Award, an Emmy award, and many honorary awards. He also won several national championships as a driver in Sports Car Club of America road racing, and his race teams won several championships in open wheel IndyCar racing. Newman was a co-founder of Newman's Own, a food company from which Newman donated all post-tax profits and royalties to charity. As of July 2011, these donations exceeded $300 million.

Description above from the Wikipedia article Paul Newman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Shaker Heights, Ohio, USA", 3.277, "/86y3mhX7mBdUC9A5B0euU8kPWmp.jpg"),
(15897, "Larry the Cable Guy", 2, "1963-02-17", null, "From Wikipedia, the free encyclopedia

Daniel Lawrence Whitney (born February 17, 1963), better known by his stage name and character Larry the Cable Guy, is an American stand-up comedian, actor and former radio personality.

He is one of the co-stars of the Blue Collar Comedy Tour, a comedy troupe which also includes Bill Engvall, Ron White, and Jeff Foxworthy, with whom he has starred on Blue Collar TV.

Larry the Cable Guy has released seven comedy albums, of which three have been certified gold by the RIAA for shipments of 500,000 copies. In addition, he has starred in three Blue Collar Comedy Tour-related movies, as well as in the films Larry the Cable Guy: Health Inspector, Delta Farce, and Witless Protection. He has also provided the voice of Mater in the Disney/Pixar films Cars and Cars 2. His catchphrase, Git-R-Done!, is the title of his book.

On January 26, 2010, the History Channel announced it was ordering a series starring Larry the Cable Guy, titled Only in America with Larry the Cable Guy, in which the comedian explores the country, immersing himself in different lifestyles, jobs and hobbies. The first episode of the series aired on February 8, 2011.

Description above from the Wikipedia article Larry the Cable Guy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Pawnee City, Nebraska, U.S.", 1.824, "/9yGwJBveIvLidqJEQI4PRuKQhMr.jpg"),
