(15903, "George Carlin", 2, "1937-05-12", "2008-06-22", "From Wikipedia, the free encyclopedia.

George Denis Patrick Carlin (May 12, 1937 – June 22, 2008) was an American stand-up comedian, social critic, actor and author, who won five Grammy Awards for his comedy albums.  Carlin was noted for his black humor as well as his thoughts on politics, the English language, psychology, religion, and various taboo subjects. Carlin and his \"Seven Dirty Words\" comedy routine were central to the 1978 U.S. Supreme Court case F.C.C. v. Pacifica Foundation, in which a narrow 5–4 decision by the justices affirmed the government's power to regulate indecent material on the public airwaves.

The first of his fourteen stand-up comedy specials for HBO was filmed in 1977. In the 1990s and 2000s, Carlin's routines focused on socio-cultural criticism of modern American society. He often commented on contemporary political issues in the United States and satirized the excesses of American culture. His final HBO special, It's Bad for Ya, was filmed less than four months before his death.

In 2004, Carlin placed second on the Comedy Central list of the 100 greatest stand-up comedians of all time, ahead of Lenny Bruce and behind Richard Pryor.  He was a frequent performer and guest host on The Tonight Show during the three-decade Johnny Carson era, and hosted the first episode of Saturday Night Live. In 2008, he was awarded the Mark Twain Prize for American Humor.

Description above from the Wikipedia article George Carlin, licensed under CC-BY-SA, full list of contributors on Wikipedia .", "New York City, New York, U.S.", 2.188, "/xmSn6p5QVn66UK2ueEJisrUR5Bg.jpg"),
(15900, "Paul Dooley", 2, "1928-02-22", null, "Dooley was born Paul Brown in Parkersburg, West Virginia, the son of Ruth Irene (née Barringer), a homemaker, and Peter James Brown, a factory worker. Dooley was a keen cartoonist as a youth and drew a strip for a local paper in Parkersburg. He joined the Navy before discovering acting while at college. He is married to writer Winnie Holzman, with whom he has one daughter, Savannah Dooley (born 1985).  Moving to New York, he soon found success as a regular on the stage. Also having an interest in comedy, Dooley was a standup comedian for five years, and a member of the Compass Players and The Second City troupe in NYC, as well as having brief stints as a magician and as a clown. Not afraid of trying different areas of entertainment, he also worked as a writer. He was one of the writers on The Electric Company and appeared in commercials.  Besides appearing in many movies, including most notably Popeye, Sixteen Candles, and Breaking Away, Dooley has also appeared as a variety of recurrent characters on numerous television shows, including My So-Called Life, Dream On, Grace Under Fire, Curb Your Enthusiasm, ALF (playing Whizzer Deaver) and Star Trek: Deep Space Nine where he played the recurring role of Enabran Tain. He guest starred in other prime time shows like Sabrina, the Teenage Witch, The Golden Girls, and Desperate Housewives. In 2000, he was nominated for an Emmy Award for his role as an eccentric judge on The Practice. He was also in the infamous alternate ending to Little Shop of Horrors, but was replaced by Jim Belushi in the final cut.  In 2010, Dooley played the part of the head chef at Camp Victory, a 

fictional fat camp, on the short-lived ABC Family original series Huge.", "Parkersburg, West Virginia, U.S.", 1.4, "/rnzvqo7oR2IwSfN2Ayh3ysc4WNt.jpg"),
