(381, "Katherine Helmond", 1, "1929-07-05", "2019-02-23", "From Wikipedia, the free encyclopedia

Katherine Marie Helmond (July 5, 1929 – February 23, 2019) was an American film, theater, and television actress and director.

Over her five decades of television acting, she was known for her starring role as ditzy matriarch Jessica Tate on the ABC prime time soap opera sitcom Soap (1977–1981) and her co-starring role as feisty mother Mona Robinson on Who's the Boss? (1984–1992). She also played Doris Sherman on Coach and Lois Whelan, the mother of Debra Barone, on Everybody Loves Raymond. She also appeared as a guest on several talk and variety shows.

Helmond had supporting roles in films such as Alfred Hitchcock's Family Plot (1976) and Terry Gilliam's Brazil (1985). She also voiced Lizzie in the three Cars films by Disney/Pixar.", "Galveston, Texas, USA", 2.588, "/9bs6UVwJ1ScvJymDO5gE9LtC3XR.jpg"),
(81113, "Jeremy Clarkson", 2, "1960-04-11", null, "Jeremy Charles Robert Clarkson (born 11 April 1960) is an English broadcaster, journalist and writer who specialises in motoring. He is best known for his role on the BBC TV show Top Gear along with co-presenters Richard Hammond and James May. He also writes weekly columns for The Sunday Times and The Sun.

From a career as a local journalist in Northern England, Clarkson rose to public prominence as a presenter of the original format of Top Gear in 1988. Since the mid-1990s Clarkson has become a recognised public personality, regularly appearing on British television presenting his own shows and appearing as a guest on other shows. As well as motoring, Clarkson has produced programmes and books on subjects such as history and engineering. From 1998 to 2000 he also hosted his own chat show, Clarkson.

His opinionated but humorous tongue-in-cheek writing and presenting style has often generated much public reaction to his viewpoints. His actions both privately and as a Top Gear presenter have also sometimes resulted in criticism from the media, politicians, pressure groups and the public.

Despite the criticism levelled against him, Clarkson has also generated a significant following from the public at large, being credited as a major factor in the resurgence of Top Gear as one of the most popular shows on the BBC.", "Doncaster, South Yorkshire, England, UK", 0.988, "/bwiGlvV08wPTEifSLwOjkA6Z0iD.jpg"),
(932721, "Dale Earnhardt Jr.", 2, "1974-10-10", null, "", "Kannapolis, North Carolina, USA", 1.4, "/axGPXTL5VvtQ2G7A7XlBIKlSPio.jpg"),
(90424, "Mario Andretti", 2, "1940-02-28", null, "From Wikipedia, the free encyclopedia.  

Mario Gabriele Andretti (born February 28, 1940) is a retired Italian American world champion racing driver, one of the most successful Americans in the history of the sport. He is one of only two drivers to win races in Formula One, IndyCar, World Sportscar Championship and NASCAR (the other being Dan Gurney). He also won races in midget cars, sprint cars, and drag racing.

During his career, Andretti won four IndyCar titles (three under USAC-sanctioning, one under CART), the 1978 Formula One World Championship, and IROC VI. To date, he remains the only driver ever to win the Indianapolis 500 (1969), Daytona 500 (1967) and the Formula One World Championship, and, along with Juan Pablo Montoya, the only driver to have won a race in the NASCAR Sprint Cup Series, Formula One, and an Indianapolis 500. No American has won a Formula One race since Andretti's victory at the 1978 Dutch Grand Prix. Andretti had 109 career wins on major circuits.

Andretti had a long career in racing. He was the only person to be named United States Driver of the Year in three decades (1967, 1978, and 1984). He was also one of only three drivers to win races on road courses, paved ovals, and dirt tracks in one season, a feat that he accomplished four times. With his final IndyCar win in April 1993, Andretti became the first driver to win IndyCar races in four different decades and the first to win automobile races of any kind in five.

In American popular culture, his name has become synonymous with speed, similar to Barney Oldfield in the early twentieth century and Stirling Moss in the United Kingdom.

Description above from the Wikipedia article Mario Andretti licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Montona, Istria, Italy  -now Motovun, Istria, Croatia", 1.164, "/kOXfjRM2e4DPaWUvMu2F8jz3JWU.jpg"),
