(1009999, "Doutzen Kroes", 1, "1985-01-23", null, "Doutzen Kroes (born 23 January 1985) is a Dutch Frisian model and actress. She began her modelling career in 2003 in the Netherlands and quickly was sent by her agency to New York where she was cast by lingerie giant Victoria’s Secret. She became a Victoria's Secret Angel for the brand in 2008. She has been a brand ambassador and spokesperson for L'Oréal Paris for over 5 years. Kroes has been in the top five of best-paid models, with an estimated income of more than five million per year since 2008. In 2014, she came in second on the Forbes top-earning models list, estimated to have earned $8 million in one year. She is considered one of the \"New Supers\" and described as \"Helen of Troy of advertising\" by Models.com.

Unlike most fellow top models, Kroes got acquainted with the fashion world relatively late. She is one of few highly successful professional models who was not discovered by any scouting agency. She got accepted at Paparazzi Model Management in Amsterdam after sending some of her holiday pictures. Her first breakthrough was when she was featured on cover of Vogue Italia in 2005. Steven Meisel shot her pictures for the cover. Just as she started her career as model for Victoria's Secret, she was voted as \"Model of The Year\" on Vogue.com in the year 2005. The year 2013 was a significantly successful year for her modeling career. In September 2013, she appeared on covers of four international editions of Vogue, making her the first model/celebrity in the history. The September issues are generally regarded as the most important issue of the year for fashion magazines, especially Vogue. She had been featured on a total of 9 Vogue covers, a count more than any other model, just in the year 2013.

Her first film debut was in Nova Zembla (2011). She is one of the active members to contribute to Dance4Life, a Dutch non-profit organization that uses song and dance to educate youth about HIV and AIDS prevention. She is also one of the supporters of Wildlife Conservation and World Wildlife Fund.", "Eastermar, Netherlands", 1.4, "/dAY10YAk55UeBzaxzMtru6Xkn59.jpg"),
