(8289, "Billy Crudup", 2, "1968-07-08", null, "William Gaither Crudup (born July 8, 1968) is an American actor. He is known for supporting roles in films including Almost Famous, Big Fish, Mission: Impossible III, Watchmen, Public Enemies, Spotlight, and Alien: Covenant, as well as lead roles in films including Without Limits, Dedication, and the animated film Princess Mononoke. He appeared in the 2017 superhero film Justice League as Doctor Henry Allen.

