(18277, "Sandra Bullock", 1, "1964-07-26", null, "Sandra Annette Bullock (born July 26, 1964) is an American actress and producer. She rose to fame in the 1990s with roles in films such as Demolition Man (1993), Speed (1994), The Net (1995), While You Were Sleeping (1995), A Time to Kill (1996), and Hope Floats (1998). In the new millennium, Bullock starred in Miss Congeniality (2000), Two Weeks Notice (2002), The Lake House (2006), and the critically acclaimed Crash (2004). In 2007, she was ranked as the 14th richest woman in the entertainment industry with an estimated fortune of $85 million. In 2009, Bullock starred in two of the more financially successful films of her career, The Proposal and The Blind Side. Bullock was awarded the Broadcast Film Critics Association Award for Best Actress, Screen Actors Guild Award for Outstanding Performance by a Female Actor in a Leading Role, Golden Globe Award for Best Actress – Motion Picture Drama, and the Academy Award for Best Actress for her role as Leigh Anne Tuohy in The Blind Side.

Bullock was born in Arlington, Virginia, a suburb of Washington, D.C. Her father, John W. Bullock (born 1925), was a United States Army employee and part-time voice coach; her mother, Helga Mathilde Meyer (1942–2000), was an opera singer and voice teacher.Bullock's father was from Birmingham, Alabama, and had English, Irish, German, and French ancestry, while Bullock's mother was German. Bullock's maternal grandfather was a rocket scientist from Nuremberg, Germany. Bullock's father, then in charge of the Army's Military Postal Service in Europe, was stationed in Nuremberg when he met his wife. They married in Germany and moved to Arlington, where John worked with the Army Materiel Command, before becoming a contractor for The Pentagon.She has a younger sister, Gesine Bullock-Prado, who was formerly the vice-president of Bullock's production company Fortis Films.

Bullock was raised in Nuremberg, Germany for twelve years and grew up speaking German.She attended the humanistic Waldorf School. As a child, Bullock frequently accompanied her mother on European opera tours. Bullock studied ballet and vocal arts as a child, taking small parts in her mother's opera productions. She sang in the operas children's choir at the Staatstheater Nürnberg. The scar above her left eye was caused when she fell into a creek as a child. Bullock attended Washington-Lee High School, where she was a cheerleader and performed in high school theater productions. After graduating in 1982, she attended East Carolina University in Greenville, North Carolina, where she received a degree in drama in 1986.She then moved to Manhattan and supported herself as a bartender, cocktail waitress, and coat checker while auditioning for roles. Until the age of eighteen, Bullock held German and American dual citizenship. In 2009 Bullock reapplied for German citizenship.", "Arlington County, Virginia, USA", 7.584, "/h14DpolXksHdpHF18ubtqslvorO.jpg"),
(4581, "Steve Coogan", 2, "1965-10-14", null, "Stephen John \"Steve\" Coogan (born 14 October 1965) is an English comedian, actor, writer and producer.

His best known character in the United Kingdom is Alan Partridge, a socially awkward and politically incorrect regional media personality, who featured in several television series, such as The Day Today, Knowing Me Knowing You with Alan Partridge and I'm Alan Partridge. Outside the UK, Coogan is better known for his film roles.", "Middleton, Manchester, England, UK", 2.776, "/tT7OXc2qA6hlREHXdwGLp0XihzA.jpg"),
(12094, "Jennifer Saunders", 1, "1958-07-12", null, "From Wikipedia, the free encyclopedia

Jennifer Jane Saunders (born 6 July 1958) is an English comedienne, screenwriter, singer and actress. She has won two BAFTAs, an International Emmy Award, a British Comedy Award, a Rose d'Or Light Entertainment Festival Award, two Writers' Guild of Great Britain Awards, and a Peoples Choice Award.

She first came into widespread attention in the 1980s and early 1990s when she became a member of The Comic Strip after graduating from the Central School of Speech and Drama. Along with her comedy partner Dawn French, she writes and stars in their eponymous sketch show, French &amp; Saunders, and has received international acclaim for writing and playing the lead role of Edina Monsoon in the BBC sitcom Absolutely Fabulous.

In her other work, she has guest starred in the American sitcoms Roseanne and Friends, and won the American People's Choice Award for voicing the wicked Fairy Godmother in DreamWorks' animated Shrek 2. More recently, she wrote and starred in Jam &amp; Jerusalem and The Life and Times of Vivienne Vyle.

Description above from the Wikipedia article Jennifer Saunders, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Sleaford, Lincolnshire, England, UK", 1.529, "/nlxiFy0LUYGlICaFY3rF2DRovcc.jpg"),
