(9195, "Hiroyuki Sanada", 2, "1960-10-12", null, "Hiroyuki Sanada (真田 広之 Sanada Hiroyuki, born Hiroyuki Shimosawa (下澤 廣之 Shimosawa Hiroyuki); 12 October 1960) is a Japanese actor from Tokyo. Before breaking in to the movie business, he trained at Sonny Chiba’s Japan Action Club hoping to one day become a martial arts action film star. Sanada appeared in many action films in the 70s and early 80s, but as it became clear he was actually a talented and well-rounded actor, he was able to branch out into all different types of roles in every genre. Today he is best known in the west for his involvement in big-budget Hollywood productions such as The Last Samurai and Rush Hour 3.", "Shinagawa, Tokyo Prefecture, Japan", 3.002, "/fljn2lkeej3gAwSOvXXMVVQlA2K.jpg"),
(1265060, "Dave Rosenbaum", 0, null, null, "Dave is currently a Production Executive at Chris Meledandri's Illumination Entertainment and has been with the company since its inception. The company's films have become some of Universal Studios most profitable of all time.  Previously, Dave was at Dreamworks and an Executive Producer for Screen Imagination Agency (SIA) in Eastern Europe. Dave's directorial debut, The Picture of Dorian Gray, was also Josh Duhamel's acting debut.  Dave earned dual degrees (BSBA and BA) from the University of Richmond in Virginia where was presented the University's highest award, The University Mace. He also holds a Masters Degree in Producing from the American Film Institute (AFI).  Dave was born in Washington, DC and is one of the only members of his family to not work for the U.S. Government.", "Washington, DC", 0.766, "/ajYL0iMlODjVhqukwIM9UuDzCyv.jpg"),
