(1903, "Alan Arkin", 2, "1934-03-26", null, "Alan Wolf Arkin (born March 26, 1934) is an American actor, director, musician and singer. He is known for starring in such films as Wait Until Dark, The Russians Are Coming, the Russians Are Coming, The Heart is a Lonely Hunter, Catch-22, The In-Laws, Edward Scissorhands, Glengarry Glen Ross, Marley & Me, Argo and Little Miss Sunshine, for which he won an Academy Award for Best Supporting Actor in 2006. He is the father of actors Adam Arkin, Anthony Arkin, and Matthew Arkin.", "New York City, New York, USA", 2.38, "/gcrKO2z0YVUXBXVeB9V8PndG0IJ.jpg"),
(1904, "Anthony Michael Hall", 2, "1968-04-14", null, "Michael Anthony Hall (born April 14, 1968), known professionally as Anthony Michael Hall, is an American actor, producer and director who starred in several teen-oriented films of the 1980s. Hall began his career in commercials and on stage as a child, and made his screen debut in 1980. His films with director-screenwriter John Hughes, beginning with the popular 1984 coming-of-age comedy Sixteen Candles, shaped his early career. Hall's next movies with Hughes were the teen classics The Breakfast Club and Weird Science, both in 1985. His performances as lovable geeks in these three films connected his name and face with the stereotype for an entire generation.

Hall diversified his roles to avoid becoming typecast as his geek persona, joining the cast of Saturday Night Live (1985–1986) and starring in films such as Out Of Bounds (1986), Johnny Be Good (1988), Edward Scissorhands (1990) and Six Degrees of Separation (1993). After a series of minor roles in the 1990s, his performance as Microsoft's Bill Gates in the 1999 film Pirates of Silicon Valley put him back in the spotlight. He had the starring role in the USA Network series The Dead Zone, from 2002 to 2007. During its run, the show was one of the highest-rated cable television series.

-From Wikipidea", "Boston, Massachusetts, USA", 3.724, "/mva8Z3Fl0zRgwVhdH1bmeiy1ey9.jpg"),
(1905, "Vincent Price", 2, "1911-05-27", "1993-10-25", "From Wikipedia, the free encyclopedia.

Vincent Leonard Price, Jr. (May 27, 1911 – October 25, 1993) was an American actor, well known for his distinctive voice and performances in horror films. His career spanned other genres, including film noir, drama, mystery, thriller, and comedy. He appeared on stage, television, radio, and in over one hundred films. He has two stars on the Hollywood Walk of Fame: one for motion pictures, and one for television.

Price was an art collector and consultant, with a degree in art history. He lectured and wrote books on the subject. He was the founder of the Vincent Price Art Museum in California. He was also a noted gourmet cook.

