(39658, "Sally Hawkins", 1, "1976-04-27", null, "Sally Cecilia Hawkins (born 27 April 1976) is an English actress. Her breakthrough performance as Poppy Cross in the 2008 film Happy-Go-Lucky won her several international awards, including the Golden Globe Award for Best Actress – Motion Picture Musical or Comedy. Other significant roles include Susan Wells in Vera Drake (2004), Sue Trinder in the BBC serial Fingersmith (2005), Anne Elliot in Persuasion (2007), Rita O'Grady in Made in Dagenham (2010), Ginger in Blue Jasmine (2013), Dr. Vivienne Graham in Godzilla (2014), Mary Brown in Paddington (2014) and Paddington 2 (2018) and Elisa Esposito in The Shape of Water (2017). For her performances in The Shape of Water and Blue Jasmine, Hawkins earned Academy Award nominations.", "London, England, UK", 4.733, "/osYgwtQIiNbPFc8JkFDxreBgqxZ.jpg"),
