(934281, "Alex Wolff", 2, "1997-11-01", null, "Alexander Draper Wolff (born November 1, 1997) is an American actor and musician. He first gained recognition for starring alongside his older brother Nat in the Nickelodeon musical comedy series The Naked Brothers Band (2007–09), which was created by the boys' mother Polly Draper. Wolff and his brother released two soundtrack albums for the series, The Naked Brothers Band and I Don't Want to Go to School, which were co-produced by their father Michael Wolff. Subsequent to the conclusion of the Nickelodeon series, Wolff and his older brother also formed a duo called Nat & Alex Wolff, and they released the album Black Sheep in 2011. Later on, Wolff began focusing his career on further acting roles. He portrayed Dzhokhar Tsarnaev in Patriots Day (2016) and John \"Derf\" Backderf in My Friend Dahmer (2017). He also starred in My Big Fat Greek Wedding 2 (2016), Jumanji: Welcome to the Jungle (2017), and Hereditary (2018).

