(22123, "Jordana Brewster", 1, "1980-04-26", null, "Jordana Brewster (born April 26, 1980) is an American actress. She began her acting career with an appearance in the soap opera All My Children (1995). After that, she joined the cast of As the World Turns (1995–2001), as a recurring role, Nikki Munson. She was later cast as one of the main characters in her first film feature film The Faculty (1998). Her role brought her to the attention of a much wider audience. She also landed a starring role in a NBC television miniseries entitled The 60s (1999).

Her breakthrough role came in the action film The Fast and the Furious (2001). Other film roles include the action comedy film D.E.B.S. (2004), the horror film The Texas Chainsaw Massacre: The Beginning (2006), and the fourth and fifth films of the The Fast and the Furious film series, Fast &amp; Furious (2009) and Fast Five (2011). She has appeared as a recurring role in the NBC television series Chuck (2008–2009).

Description above from the Wikipedia article Jordana Brewster, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "Panama City, Panama", 5.603, "/zs8m5tuqHfMk9qANznNgmvmLwDn.jpg"),
(17647, "Michelle Rodriguez", 1, "1978-07-12", null, "Mayte Michelle Rodríguez (born July 12, 1978), known professionally as Michelle Rodriguez, is an American actress, screenwriter, and DJ. She got her breakout role as a troubled boxer in the independent film Girlfight (2000), which was met with critical acclaim and earned her several awards, including the Independent Spirit Award and Gotham Award for Best Debut Performance. The following year, she starred as Letty Ortiz in the blockbuster film The Fast and the Furious (2001), reprising her role in its sequels Fast & Furious (2009), Fast & Furious 6 (2013), and Furious 7 (2015).

During her career, Rodriguez has played tough, independent women in a number of successful action films, such as Blue Crush, S.W.A.T., Battle: Los Angeles, and Avatar. She is also known for her roles as Shé in the action comedy films Machete and Machete Kills, and Rain Ocampo in the science fiction films Resident Evil and Resident Evil: Retribution.

Rodriguez also branched into television, playing Ana Lucia Cortez in the second season of the series Lost as part of the main cast, before making numerous guest appearances before the series ended. She has also done voice work in video games such as Call of Duty and Halo, and lent her voice for the 3D animated film Turbo and the television series IGPX.

With her films grossing over $5 billion collectively, a 2013 Entertainment Weekly article described Rodriguez as \"arguably the most iconic actress in the action genre, as well as one of the most visible Latinas in Hollywood\".", "Bexar County, Texas, USA", 6.481, "/soXPKCMmOxT7oyfGsMUHB6YHLcC.jpg"),
